import React, { Component } from 'react';
import './App.css';
import Person from './Profile/Profile';

class App extends Component{
  render(){
    return (
      <div className="App">
        <h1> Hi, This is my Blog </h1>
        <p> You'll see details about me here! </p>
        <p> I am {Math.ceil((Math.random() * 30)*10)/10} years old</p>
        <Person name="Cristiano" age="35" >Best Player on the Planet</Person>
        <Person name="Memphis" age="27" />
      </div>
    );  
  }
}

export default App;
